Accounts_CustomFields_Description:
Érvényes JSON adatnak kell lennie, ahol a kulcsok a mezőbeállítások szótárát tartalmazó mezőnevek. Például:<br/><code>{
 "role": {
  "type": "select",
  "defaultValue": "student",
  "options": ["teacher", "student"],
  "required": true,
  "modifyRecordField": {
   "array": true,
   "field": "roles"
  }
 },
 "twitter": {
  "type": "text",
  "required": true,
  "minLength": 2,
  "maxLength": 10
 }
}</code>

Custom_Translations_Description:
Valódi JSON legyen, ahol a kulcsok olyan nyelvek, amelyek kulcsszót tartalmaznak és fordítások. Például:<br/><code>{
"en": {
"Csatornák": "Szobák"
},
"pt": {
"Csatornák": "Salas"
}
}</code>
